  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve carcasses were submitted for necropsy
  from Modoc National Wildlife  Refuge (NWR) during the 1984-85 Lead Poisoning Monitoring
  Program; one Canada goose was diagnosed as lead poisoned. civers from 12 (12%) of
  99 hunter-killed mallards had elevated lead concentrations (>2 ppm, wet weight);
  concentrations greater than 8 ppm, usually considered toxic if accompanied by gross
  lesions of lead poisoning, occurred in three (3%). One or more ingested lead shot
  was found in five (5%) of 100 gizzards.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
